import React, { useContext, useState } from "react";
import CopyToClipboard, { copyToClipboard } from "react-copy-to-clipboard";
import { SocketContext } from "../SocketContext";

const Options = ({ children }) => {
  const { callAccepted, name, setName, callEnded, me, callUser, leaveCall } =
    useContext(SocketContext);

  const [idToCall, setIdToCall] = useState("");

  return (
    <div className="mt-8">
      options
      <div>
        <div className="flex justify-between p-4 border-2 w-[500px] h-40 bg-white">
          <div className="flex flex-col gap-4">
            <h1>Acount Info</h1>
            <input
              type="text"
              value={name}
              onChange={(e) => setName(e.target.value)}
              placeholder="Name"
              className="border-2 rounded"
            />
            <CopyToClipboard>
              <button className="border-2 bg-gray-200 rounded">
                Copy Your ID
              </button>
            </CopyToClipboard>
          </div>
          <div className="flex flex-col gap-4">
            <h1>Make a call</h1>
            <input
              type="text"
              value={idToCall}
              onChange={(e) => setIdToCall(e.target.value)}
              placeholder="Id to Call"
              className="border-2 rounded"
            />
               <button className="border-2 bg-gray-200 rounded">
                Copy Your ID
              </button>
          </div>
        </div>
      </div>
      {children}
    </div>
  );
};

export default Options;
